import React from 'react';
import { useTranslation } from 'react-i18next';
import { motion } from 'framer-motion';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faDownload, 
  faCakeCandles, 
  faPhone, 
  faEnvelope, 
  faLocationDot, 
  faBriefcase 
} from '@fortawesome/free-solid-svg-icons';
import './About.css';

const About = () => {
  const { t } = useTranslation();

  // Animaciones
  const containerVariants = {
    hidden: {},
    visible: {
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: {
      y: 20,
      opacity: 0
    },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        duration: 0.6,
        ease: "easeOut"
      }
    }
  };

  return (
    <section id="about" className="about">
      <div className="container about-container">
        <div className="about-title">
          <motion.h2
            initial={{ opacity: 0, y: -10 }}
            whileInView={{ opacity: 1, y: 0 }}
            viewport={{ once: true, amount: 0.2 }}
            transition={{ delay: 0.1, duration: 0.5 }}
          >
            {t('about.titulo')}
          </motion.h2>
          <div className="underline"></div>
          <p className="section-subtitle">
            {t('about.subtitle')}
          </p>
        </div>

        <motion.div 
          className="about-content"
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true, amount: 0.2 }}
        >
          <motion.div 
            className="about-text"
            variants={itemVariants}
          >
            <p>
              {t('about.parrafo1')}
            </p>
            <p>
              {t('about.parrafo2')}
            </p>
            <p>
              {t('about.parrafo3')}
            </p>
            
            <div className="cv-download">
              <a href="/assets/CV_Diego_Moreno.pdf" className="download-btn" download>
                <FontAwesomeIcon icon={faDownload} />
                {t('about.descargarCV')}
              </a>
            </div>
          </motion.div>
          
          <motion.div 
            className="about-info"
            variants={itemVariants}
          >
            <h3>{t('about.datosPersonales')}</h3>
            <ul className="info-list">
              <li>
                <FontAwesomeIcon icon={faCakeCandles} />
                <span className="info-title">{t('about.cumpleanos')}:</span>
                <span>13 de Febrero, 1987</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faPhone} />
                <span className="info-title">{t('about.telefono')}:</span>
                <span>+34 600 000 000</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faEnvelope} />
                <span className="info-title">Email:</span>
                <span>info@diegomoreno.dev</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faLocationDot} />
                <span className="info-title">{t('about.direccion')}:</span>
                <span>Valencia, Espa√±a</span>
              </li>
              <li>
                <FontAwesomeIcon icon={faBriefcase} />
                <span className="info-title">{t('about.cargo')}:</span>
                <span>Desarrollador Web Full-Stack</span>
              </li>
            </ul>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default About;
